import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Container} from 'react-bootstrap';

function Home() {
  const navigate = useNavigate();
  return (
    <div 
      className="d-flex justify-content-center align-items-center text-center bg-image"
      style={{
        backgroundImage: "url('/images/home1.png')",
        backgroundSize: "cover",
        backgroundPosition: "center",
        height: "100vh",
        color: "white",
      }}
    >
      <div>
        <h1 className="display-4">SISTEM IDENTIFIKASI PENYAKIT PADI</h1>
        <p className="lead">Solusi Cerdas untuk Petani</p>
      </div>
    </div>
  );
}

export default Home;
